import { View, Text, TextInput, SafeAreaView } from "react-native";

const JoinSession = ({ navigation }) => {
  return (
    <SafeAreaView>
      <View>
        <Text>Join Session</Text>
        
      </View>
    </SafeAreaView>
  );
};

export default JoinSession;
